INSERT INTO `postevent_postevent` VALUES (1,'dhanak2015','saisasthaa@gmail.com',1234567890,'Regular Capoeira classes','2015-10-24 00:00:00','2015-10-31 00:00:00',1,1,'Dhanak is the annual cultural fest of the Indian Institute of Space Science & Technology, Trivandrum. It is a four-day long event held in the odd semester  each year and is attended by students from across South India and some parts of North India. With events ranging from literary & music-art-dance to visual arts & film-making, it presents the perfect platform to expose the participants to healthy competition and also bag prizes while they are at it.','\r\nClosest Airport - Trivandrum Internation Airport ','Tamilnadu','pondicherry','manakula','Computer science','static/img/party-music-hd-wallpaper-1920x1200-3850.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Pretheev','pretheevraj@gmail.com',8754405589,'Qubit\'15 (technoVIT\'15)','2015-10-14 00:00:00','2015-10-16 00:00:00',1,6,'Qubit\'15 is an event presented by Computing Science and Engineering . And technoVIT\'15 is the overall fest conducted by VIT Chennai.','Vandalur, Kelambakkam Road, Chennai, Tamil Nadu 600127','Tamilnadu','Chennai','VIT University Chennai Campus','cse','static/img/11953199_1640028686253445_335380266701552541_n.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'Pretheev','pretheevraj@gmail.com',8754405589,'Fiesta de Mercadeo 15','2015-10-14 00:00:00','2015-10-15 00:00:00',5,7,'A national level techno-management-Law & cultural Fest events to be held on 14th and 15th of OCTOBER at Alliance University.','Chikkahagade Cross, Chandapura - Anekal Main Road, Anekal\r\nBengaluru – 562 106, Karnataka, India.',' Karnataka','Bengaluru','Fiesta de Mercadeo 15','MBA, Commerce, Law, BBA','static/img/galeria_flyer_1_r7_c1.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Pradeepa','rpradeepa812@gmail.com',9789761928,'Student Led Design Conference','2015-10-30 00:00:00','2015-11-01 00:00:00',1,4,'AMERICAN SOCIETY OF MECHANICAL ENGINEERS INDIA’S STUDENT LED DESIGN CONFERENCE (SLDC 2015)\r\n\r\nIS A ZONAL LEVEL CONFERENCE TO BE HELD FOR THE FIRST TIME IN NIT, ROURKELA.\r\n\r\nSLDC BRINGS THIS INNOVISION (30TH OCT-1ST NOV, 2015), A SYMPOSIUM ALONG WITH A PLATFORM TO\r\n\r\nSHOWCASE ONE\'S ABILITIES AND A CHANCE TO BRING INTO ACTION ALL THE IDEAS.','Rourkela ','Bangalore','Rourkela ','ASME NIT','MECHANICAL ENGINEERING','/events/static/img/logo.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,'priya','avbmail93@gmail.com',8148456121,'technical event','2015-10-13 00:00:00','2015-10-14 00:00:00',1,1,'workshop on NS2 ','Sree sowdambika college of engineering ,\r\nMadurai','Tamil Nadu','Madurai','SSCE','CSE','/events/gallery7-2.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Pretheev','pretheevraj@gmail.com',8754405589,'Inflore \'15','2015-10-15 00:00:00','2015-10-16 00:00:00',3,3,'Inflore – the national management fest of Rajagiri Centre for Business Studies celebrated its 11th year this year. Inflore is firmly established as one of the leading business management fests in the country. Inflore serves as a platform for students from various B-schools to showcase their prowess in management and prove their caliber and fortitude through competence and intellect. A completely student driven initiative, Inflore has successfully created a name for itself amongst the B-schools of Kerala by constantly pushing the envelope and surpassing expectations.\r\nOver the years, Inflore has embodied the spirit of Indian Cinema, the enigma of the Egyptian participation of over 1800 contestants from over 200 colleges, including the IIMs, battling it out to prove their mettle amongst the best of in country. We had a footfall of more than 8000 people\r\nduring INFLORE\'14, with an impressive reach of over 1 lakh people. Students compete with one another in proving their prowess in various events through exceeding wit and intellect, winning prizes worth over 4 lakhs.','Rajagiri Centre for Business Studies\r\nRajagiri Valley P. O, Kakkanad,\r\nKochi - 682 039, Kerala,\r\nIndia.','Kerala','Kochi','Rajagiri Center for Business Studies','Management Fest','/events/59.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,'pretheev','pretheevraj@gmail.com',8754405589,'17th FUTURA','2015-10-15 00:00:00','2015-10-17 00:00:00',1,6,'\r\n17th Futura is one of the renowned techno-fest ever held in the region where the technology meets innovation to \"Reach the Unreached\".','Bannari Amman Institute of Technology\r\nSathyamangalam\r\nTamil Nadu\r\nIndia\r\n','Tamil Nadu','Sathyamangalam',' Bannari Amman Institute of Technology','All','static/img/a0118453_123737100.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(20,'Pradeepa','rpradeepa812@gmail.com',9789761928,'EREKZ 2K15','2015-10-26 00:00:00','2015-10-27 00:00:00',5,6,'We present you a place to showcase your talents and show the world your capability.\r\n\r\nTechnical Events:\r\n\r\nSurvival of the fastest\r\n\r\nPhap\'y\r\n\r\nBio Skica\r\n\r\nAdzapp\r\n\r\nNon-Technical Events:\r\n\r\nBon voyage\r\n\r\nChain Reaction\r\n\r\nHacktrack\r\n\r\nCanYou Escape\r\n\r\nMission Impossible','Jeppiaar Engineering College,\r\nJEPPIAAR NAGAR, \r\nRAJIV GANDHI ROAD,\r\n CHENNAI-600119','Tamil Nadu','Chennai','Jeppiaar Engineering College','BIOTECHNOLOGY','/events/col.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(21,'Pradeepa','rpradeepa812@gmail.com',9789761928,'UAVDC\'16','2015-10-28 00:00:00','2015-10-29 00:00:00',1,1,'Two-Day UAV Design & Autopilot Programming Workshop & Qualifier for UAV Design Challenge \'\'16.\r\n\r\nIt is a hands-on workshop on UAV(Drone) Design and Autopilot Workshop. Each team will built a fixed wing aircraft and convert that into an UAV with an autopilot board.\r\n\r\nTop 4 team will qualifier for the next round of UAV Design Challenge \'\'16 and will get 35% concession on the entry fee.','Thiruvalluvar College of Engineering & Technology,\r\nVandavasi, Tamilnadu, India.','Tamil Nadu','Vandavasi','Thiruvalluvar College of Engineering & Technology','Aero Department','/events/Thiruvalluvar College of Engineering & Technology vandavasi.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(24,'Pretheev','pretheevraj@gmail.com',8754405589,'Arohan 15','2015-10-24 00:00:00','2015-10-26 00:00:00',5,7,'AROHAN’15 - NITIE Annual Cultural Festival from 24th-26th October, 2015 under the umbrella of AVARTAN - the NITIE Business Confluence.\r\n\r\nThe 3 day extravaganza is a confluence of Art, Culture and Entertainment. With a plethora of events, the fest is an opportune platform to showcase your skills to the world.\r\n\r\nBe a part of one of the biggest cultural fests in India. We enthusiastically look forward to your participation','NITIE, Vihar Lake Marg, Near The Residence Hotel, Powai, Mumbai, Maharashtra 400087','Maharashtra','Mumbai','National Institute of Industrial Engineering NITIE','All','static/img/images.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(25,'Deepak','deepak@gloabalensolutions.com',9789761928,'INTERNATIONAL WINTER INTERNSHIP&TRAINING PROGRAM','2015-12-09 00:00:00','2015-12-12 00:00:00',1,6,' INTERNSHIP TRAINING CONTENT ENGINE ASSEMBLING AND DISMANTLING  (HANDS-ON SESSIONS)\r\n\r\n     AUTOMOTIVE AERODYNAMICS\r\n    AUTOMOTIVE ELECTRONICS\r\n    ENGINE MODIFICATIONS \r\n    VEHICLE CHASSIS\r\n    VEHICLE TRANSMISSION\r\n    Group Activity – Problem Statement and Solution Discussion\r\n    Automobile Industry Expectation (PLACEMENT ASSISTANCE)\r\n\r\nHIGHLIGHTS      * ISO CERTIFIED CERTIFICATES WITH HOLOGRAM will be provided by Top engineers  in collaboration with sreesanth motors to all the participants by the end of the internship which will add value during placements.\r\n\r\n Registration Fee:\r\nRS.3000 /per participant\r\n (Includes Taxes, Registration kit, Hands-On Lab, Certification Cost, Human Resources fee).\r\n\r\n(FOR CHENNAI)Pay initial amount of Rs.500/- before DECEMBER 4TH , 2015 and Confirm Your Seat and the rest can be paid On the spot.\r\n\r\nGROUP DISCOUNT OFFER\r\nGroup of 5 & above will get discount Rs.250/- per head\r\nGroup of 10 & above will get discount Rs.500/- per head\r\n\r\nRs.350 discount for individual participant who attended workshop with TOP ENGINEERS earlier (group discount is not applicable here) \r\n','TOP ENGINEERS\r\nCHENNAI, TAMIL NADU, INDIA\r\n','Tamil Nadu','Chennai','TOP ENGINEERS','AUTOMOBILE','static/img/TOP_ENGINEERS_PVT_LTD_CHENNAI.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(26,'Deepak','deepak@gloabalensolutions.com',9789761928,'A Two Day Workshop on IOT – Internet of Things','2015-10-29 00:00:00','2015-10-30 00:00:00',1,1,'Overview of Workshop:\r\n•          What “the Internet of Things”\r\n•          How open platforms allow you to store your sensor data.\r\n•          The basic usage of the Arduino environment for creating your own embedded projects at low cost\r\n•          How to connect your Arduino with your Android phone.\r\n•          How to send data to the Internet and talk to the Cloud/server.\r\n•          How to update sensor readings on social media.\r\n•          Control a Relay Switch by texting from your Phone.\r\n•          Use Arduino, Wifi, Bluetooth, Breadboard, LEDs, sensors like temperature sensor\r\n','VIT University, Vellore','Tamil Nadu','Vellore','VIT University','School of Computing Science & Engineering','static/img/VIT_University-www.tamilnaducollegeevents.in.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,'Deepak','deepak@gloabalensolutions.com',9789761928,'Workshop on Time Series Econometrics','2015-10-20 00:00:00','2015-10-20 00:00:00',2,1,'WORKSHOP THEME\r\nEconomic theories associated with long run relationship between variables have been analysed using econometric techniques, since the origin of the subject. Statistical packages such as STATA & E-Views come in handy to analyse the time series and panel data analysis. The workshop will provide a general and brief outline of some of the important models associated with the time series analysis. There will be hands on training with a data set using the E-Views.\r\n\r\nTOPICS TO BE COVERED\r\nForenoon Session:\r\nStructural Vector Autoregressive (SVAR) and Structural Vector Error Correction Model (SVECM) – General Introduction, uses. Brief description of co-integration analysis using E-Views\r\nAfternoon Session:\r\nHands on training with a data set, question session and concluding remarks.','SRM University\r\nKattankulathur, TamilNadu, India','Tamil Nadu','Chennai','SRM University','Department of Economics','static/img/SRM_University-www.tamilnaducollegeevents.in.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(28,'Deepak','deepak@gloabalensolutions.com',9789761928,'Workshop on “MARINE BIOPROSPECTING\"','2015-10-26 00:00:00','2015-10-31 00:00:00',1,1,'Registration Fee:\r\nRegistration fees: Rs. 2,000/-*\r\nLimited no. of participants, Registration will be First-Come-First-Serve basis.\r\n\r\n*Registration fee includes education material & lunch and Tea during Workshop.\r\n*Limited accommodation may be arranged in the vicinity of premises on payment basis).\r\n\r\n About Event:\r\nMarine bioprospecting – the search for novel compounds from natural sources in the marine environment has increased rapidly in recent years. Much of the increase in activity may be attributed to technological advances in exploring the ocean and the genetic diversity it contains. Much of the marine biome remains under-investigated and the prospect for new and unique findings is high, particularly in the microbial realm. The Apex Biotechnology Training and Research Institute invite you to this workshop on “MARINE BIOPROSPECTING – MARINE MICROBIAL PERSPECTIVES” between 26th and 31st October 2015 to be held at Apex Biotechnology Training and Research Institute, Chennai where researchers will be able to understand the basic instrumentation and steps involved in Marine Bioprospecting from Microbial Source.\r\n\r\nOther Details:\r\nApply to the Workshop\r\nThe Apex Biotechnology Training and Research Institute accept registration on or before 24th October 2015. The registration form can be downloaded at http://www.apexbiotechtraining.in/training.html','Apex Biotechnology Training and Research Institute\r\nTS. 89, Thiru Vi Ka Industrial Estate\r\nEkkaduthangal, Guindy, Chennai 600 032\r\nTele / Fax: 044 4360 4545 \r\nMobile: +91 99625 22686\r\nE-mail: apexbiotechchennai@gmail.com \r\nWebsite: www.apexbiotechtraining.in','Tamil Nadu','Chennai','Apex Biotechnology Training and Research Institute','Marine Biotechnology','static/img/Apex_Biotechnology_Training_and_Research_Institute_Chennai.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(31,'Deepak','deepak@gloabalensolutions.com',9789761928,'ICARBEST\'15','2015-10-19 00:00:00','2015-10-19 00:00:00',5,4,' Scope of the Conference:\r\n\r\nInternational Online Conference on Advanced Research in Biology, Ecology, Science and Technology (ICARBEST’15) is an Online Conference organized to showcase the talents of research scholars, engineers, scientists, UG and PG students by presenting papers from their home through audio/video presentation. Participants can therefore receive hard copy of all Certificates and Proceedings from their home without the need to travel. This enables young budding engineers to meet and exchange their ideas and explore new avenues of research and development.\r\n\r\nConference Topics:\r\n•          Bioinformatics\r\n•          Biomedical Engineering\r\n•          Biotechnology\r\n•          Chemical Engineering\r\n•          Civil Engineering\r\n•          Communications\r\n•          Computer Engineering\r\n•          Computer Applications\r\n•          Construction Management\r\n•          Educational Media / Instructional Technology\r\n•          Electrical and Electronics Engineering\r\n•          Human Resources Management\r\n•          Information Technology\r\n•          Mechanical Engineering\r\n•          Management Technology\r\n\r\nSubmission of Papers:\r\n•         Authors are invited to send their papers in IEEE format\r\n•        All manuscripts must be the author(s) original, un-published work and must not be under - consideration for publication elsewhere.\r\n•      Each manuscript must include a 125 to 150 word abstract and a list of 4-to-7 keywords. The article length must be less than or equal to 8 pages.\r\n•      All selected and presented papers will be published in International Journal of Advanced Research in Biology, Ecology, Science and Technology (IJARBEST)\r\nSend your papers to icarbest@gmail.com\r\n\r\nImportant Dates:\r\n\r\nPaper Submission            :  6th November 2015\r\nAcceptance Notification    : 13th November 2015\r\nFinal Camera Ready Paper Submission\r\nWith Registration and Presentation in CD/DVD    : 19th November 2015\r\n(Audio/Video) \r\nJournal Publication        : 24th November 2015      \r\n\r\nRegistration fee:\r\n\r\nUG/PG students                   : Rs.1500 (2 authors)\r\nFaculty/Research Scholars    : Rs.1800  (2 authors)\r\nDelegates from Industry         : Rs.2000   (2 authors)\r\n\r\nNote: For every extra author, Rs.500 should be added to the total amount\r\n\r\nAuthors can credit the payment to the concerned account numbers mentioned in the acceptance mail and the mode of payment can be either through online banking or direct branch deposit.\r\n\r\nConference Takeaway:\r\n•          Hard copy of International Conference Certificate for all authors\r\n•          Hard copy of International Journal Certificate for all authors\r\n•          Best paper certificate (only to the best article)\r\n•          Conference Proceedings\r\n•          Journal Publication\r\n•          Indexing of your paper in 24 websites including Google Scholar\r\n\r\nProcedure:\r\n•          Send your paper to icarbest@gmail.com\r\n•          If paper is accepted, get acceptance mail from Conference organizer through mail (with transaction details)\r\n•          Send final Camera ready paper, Registration form , Soft copy of transaction slip through mail and Audio/Video file of your presentation in CD/DVD to correspondence address (before 19th November 2015)\r\n•          Receive your Conference Particulars & Journal Publication details through Courier/Speed Post before 24th November 2015','INTERNATIONAL JOURNAL OF ADVANCED RESEARCH IN BIOLOGY, ECOLOGY, SCIENCE AND TECHNOLOGY (IJARBEST)\r\nTirunelveli, Tamilnadu, India\r\n','Tamil Nadu','Tirunelveli','IJARBEST','Multidisciplinary','static/img/INTERNATIONAL_JOURNAL_OF_ADVANCED_RESEARCH_IN_BIOLOGY_ECOLOGY_SCIENCE_AND_TECHNOLOGY_IJARBEST.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(32,'Deepak','deepak@gloabalensolutions.com',9789761928,'International Conference on Researches on Eng ','2015-11-02 00:00:00','2015-11-02 00:00:00',1,4,' International Conference on Recent Researches in Engineering, Science and Technology (ICRREST) will explores the knowledge between Engineers, Scientists, Scholars, Industrialist and Students in the field of Engineering, Science and Technology across the world. We will be very honorable and happy to have you as one of our most delightful participants in the conference by presenting your research work.\r\n\r\nOther Details:\r\nSubmit your papers at iericrrest@gmail.com\r\n\r\nRegistration Fees:-\r\n\r\n1)A Conference Kit (A Laptop Bag, Scribling pad, Pen, Lunch on the day of Conference)\r\n2)Soft copy of Proceedings with Conference Serial Number(CSN) and ISBN.\r\n3)The proceedings will be placed in the Proceedings Xplorer.\r\n\r\nNote:-Only one certificate will be issued per Registration.Extra certificates will be issued by paying addtitional fees of Rs.500 per author\r\n','Institute of Engineering Research\r\nSalem, Tamil Nadu, India','Tamil Nadu','Salem','Institute of Engineering Research','ALL DEPARMENTS','static/img/Institute_of_Engineering_Research_Salem.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(33,'Pretheev','Pretheevraj@gmail.com',8754405589,'Media Fest','2015-11-24 00:00:00','2015-11-26 00:00:00',3,8,'Mumbai Media Champs is an annual media festival celebrated in the month of January, organized by the students of DGMC. Having over 30 events pertaining to various fields in media, MMC plans to be Mumbai\'s largest media festival. As the name suggests, the fest relates to media enthusiasts and explorers of the field who participate and is a guest for Team MMC.','Opposite Bajaj Bhavan, Swami Vivekanand Road, Sunder Nagar, Malad West, Mumbai, Maharashtra 400064','Maharashtra','Mumbai','Deviprasad Goenka Management Institute of Media St','Media','static/img/10940624_663538233756168_6786342457534023360_n.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(34,'Deepak','deepak@gloabalensolutions.com',9789761928,'Aatral 2k15','2015-11-07 00:00:00','2015-11-07 00:00:00',1,9,'Aatral - National level technical symposium organized every year by the department of Electronics and Communication Engineering of Velammal Institute of Technology, Chennai. Aatral 2k15 is the most awaited event having many brain storming technical events and nail biting surprising events. Lots of prizes are to be won and lots are fun are awaiting. Meet you all on 11-07-2015 in the battle of brains. ',' Velammal Institute of Technology, Chennai, Tamil Nadu, India ','Tamil Nadu','Chennai','Velammal Institute of Technology','Electronics & Communication Engineering','static/img/Velammal_Institute_of_Technology_Chennai.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(35,'Deepak','deepak@gloabalensolutions.com',9789761928,'FECTRA 2k16','2016-02-11 00:00:00','2016-02-11 00:00:00',1,9,'A National level technical symposium\r\n\r\n\r\nEvents\r\nPaper Presentation Project Presentation\r\nLive Wire\r\nCode - E - Thon\r\nRapid Data\r\nPhotopay\r\nVisual Hunt\r\nGame Seeks\r\n\r\nRegistration Fees:No Registeration Fees\r\n','Kongu Engineering College\r\nErode\r\nTamil Nadu\r\nIndia','Tamil Nadu','Erode','Kongu Engineering College','Electronics & Communication Engineering','static/img/fectan.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(36,'Pretheev','Pretheevraj@gmail.com',8754405589,'Mirage 2015','2015-12-09 00:00:00','2015-12-14 00:00:00',2,7,'The BMS Section Nagindas Khandwala College, Malad organises a 5 day festival called Mirage every year from the past 14 years. On the first day of Mirage we have a incredible opening night. In 2014, Mirage Incredible Night with DJ Chetas witnessed a footfall of 13000 students from all over the city.',' Road No.1, Off S V Road, Bhadran Nagar, Malad West, Mumbai, Maharashtra 400064','Maharashtra','Mumbai','Nagindas khandwala college','Nagindas khandwala college','static/img/1526097_634822280850195802-1.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(37,'Deepak','deepak@gloabalensolutions.com',9789761928,' National Symposium on Instrumentation','2015-10-30 00:00:00','2015-10-31 00:00:00',1,9,'Kumaraguru College of Technology (KCT) and Instrument Society of India (ISOI) of Indian Institute of Science (IISc), Bangalore are jointly organizing the Fortieth National Symposium on Instrumentation (NSI 40) during October 30th and 31st 2015, Coimbatore, Tamil Nadu, INDIA.\r\n\r\nNSI 40, is to bring together innovative academicians and industry experts in the fields of Electronics, Process Instrumentation, Control and Automation to a common forum.\r\n\r\nLeading Researchers from DRDO, ISRO, IISc, IIT and CSIR will be delivering keynote address during this meet.\r\n\r\nWe are happy to invite your research findings to be presented during this conference.\r\n\r\nEvents\r\nPre-Conference Workshops\r\nWorkshops\r\nPaper Presentations\r\n\r\n\r\nRegistration Fees:\r\nDelegates: Rs. 3,500/-\r\nISOI Life Members: Rs. 2,500/-\r\nResearch Scholars: Rs. 2,500/-\r\nUndergraduate / Post-graduate Students: Rs. 2,000/-\r\n\r\nImportant Dates\r\nFest Date: 30 - 10 - 2015 to 31 - 10 - 2015\r\nLast Dates for Registration: Last Date for Submission of Abstracts : 20 - 08 - 2015\r\nIntimation of Acceptance : 01 - 09 - 2015\r\nLast Date for Registration : 01 - 10 - 2015\r\n','Kumarguru College of Technology\r\nCoimbatore\r\nTamil Nadu\r\nIndia','Tamil Nadu','Coimbatore','Kumarguru College of Technology','ALL DEPARMENTS','static/img/dance.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(38,'Pretheev','Pretheevraj@gmail.com',8754405589,'RAY 2015','2015-12-15 00:00:00','2015-12-20 00:00:00',5,8,'Ray - A journey through the lens, is the annual intercollegiate media festival of Bhavan\'s college, Andheri west.\r\n\r\nIt is one of the top media festivals of Mumbai that takes place in the month of December.\r\n\r\nIn its 7th glorious year, we have expanded our horizon and took the standard of it on a whole new level.','Munshi Nagar, Andheri West, Mumbai, Maharashtra 400058','Maharashtra','Mumbai','Bhavans College Mumbai','Art media','static/img/Bharatiya-Vidya-Bhavans-Institute-Of-Communication-3.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(39,'Pradeepa','rpradeepa812@gmail.com',9789761928,'Pragyan 2016','2016-02-25 00:00:00','2016-02-26 00:00:00',1,1,'Pragyan is the annual international Techno-Management festival of National Institute of Technology, Trichy. Pragyan has events spanning the entire engineering spectrum, in addition to the management events that have provided a common platform to the smartest talent across the country and abroad. It serves as a great tool to dissolve the barriers between industry and students.\r\n\r\nIn addition to the wide range of events, Pragyan also has technical workshops, Guest Lectures, Tech-Talks, Exhibitions, Crossfire (panel discussion) , Infotainment Shows and much more.','National Institute of Technology, Trichy','Tamil Nadu','Trichy','National Institute of Technology','MECHANICAL ENGINEERING','/events/YANTRAM\'15.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(40,'Deepak','deepak@gloabalensolutions.com',9789761928,'AutoKriti 7.0 ','2015-10-26 00:00:00','2015-10-08 00:00:00',1,1,'SAEINDIA NIT Kurukshetra Collegiate Club presents the most awaited AUTOMOTIVE workshop of North India- AUTOKRITI 7.0.\r\n\r\n\"AUTOKRITI 7.0 A Petrol v/s Diesel Car Overhaul Workshop\" is a National Workshop organised by SAEINDIA NIT Kurukshetra Collegiate Club, the NIT Kurushetra Chapter of Society of Automotive Engineers (SAE). It is the same Club that umbrellas the Team NITROX, the team that crushed all other NITs, IITs, BITS Pilani, DTU and other leading Engineering colleges of India in SAE BAJA 2015 and secured an adorable ALL INDIA 7th RANK out of 320 teams in a CUT THROAT COMPETITION, Team Accelerons And Team Ibrido\r\nIt is a chance for you to learn from the CHAMPIONS!\r\nA unique workshop where you will be allowed to disassemble, study and assemble car components WITH YOUR OWN HANDS. An experience which no book can teach and no lab can give.','NIT Kurukshetra\r\nHaryana','Haryana','Kurukshetra','NIT','ALL DEPARMENTS','static/img/events.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(41,'Deepak','deepak@gloabalensolutions.com',9789761928,'UAV Design & Autopilot Workshop','2015-10-28 00:00:00','2015-10-29 00:00:00',1,1,'Maavan UAV Design Challenge 2016\r\n\r\nTop four teams will qualify for the next level of India’s first & biggest UAV Design Challenge to be held at Coimbatore on 25th-26th March 2016.\r\nSYLLABUS\r\nDAY-I\r\n\r\nSESSION-1 (9.30 AM to 11.00 AM)\r\nDesign Approach for Fixed Wing Aircraft\r\n\r\nIntroduction to Autopilot Physical Modelling Approach\r\nDetermination of Mass and Inertial Characteristics\r\nCentre of Gravity measurement\r\nDetermination of Wing Characteristics\r\nCalculation of Wing Area\r\nCalculation of Mean Aerodynamic chord\r\nCalculation of Wing Loading\r\n\r\nSESSION-2 (11.30 AM to 1.00 PM; 2.00PM to 3.00PM)\r\nComponents used in sUAV\r\n\r\nPropulsive Devices – BLDC Motors\r\nPropeller\r\nMEMS Sensors\r\nUltrasonic Sensor\r\nAtmospheric Pressure Sensor\r\nAirspeed Sensor\r\n3-Axis Gyros\r\n3-Axis Accelerometer\r\n3-Axis Magnetometer\r\nActuators – Servo Motor\r\nRadios – 2.4 GHz Tx & Rx\r\nTelemetry – 5.6 GHz / 2.4 GHz\r\nBatteries – LiPo\r\n\r\nSESSION-3 (3.00 PM to 4.30 PM)\r\nProgramming and Interfacing of MEMS Sensors & Actuators using Arduino\r\n\r\nArduino IDE & Arduino Mega\r\nUltrasonic Sensor\r\nAirspeed Sensor\r\n3-Axis Gyros / 3-Axis Accelerometer / Temperature Sensor\r\n3-Axis Magnetometer / Atmospheric Pressure Sensor\r\nBLDC Motor /\r\nServo Motor\r\n\r\nDAY-II\r\n\r\nSESSION-4 (9.30 AM to 11.00 AM)\r\nHands-on Session of Autopilot Integration\r\n\r\nIntroduction to Autopilot Mega Platform\r\nTuning of Control Surfaces\r\nCalibration of Autopilot Board\r\n\r\nSESSION-5 (11.30 AM to 1PM; 2PM to 3PM)\r\nHands-on Session of Autopilot Integration\r\n\r\nIntro to Ground Station Software\r\nCommands and Keywords related to Mission Planner\r\nMission Planning\r\nParameter Configuration\r\nGPS Waypoints Setting\r\nPre-Flight Checking\r\nGround Testing\r\n\r\nSESSION-6 (3.30 PM to 4.30 PM)','Thiruvalluvar College of Engineering and Technology\r\nVandavasi, Tamil Nadu','Tamil Nadu','Vandavasi','Thiruvalluvar College of Engineering and Technolog','ALL DEPARMENTS','static/img/events_1.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(42,'Deepak','deepak@gloabalensolutions.com',9789761928,'PECfest 2015','2015-10-30 00:00:00','2015-10-01 00:00:00',5,6,' PECFEST 2015 is an expression of freedom and rebellion, of team spirit and determination; a 3-day technical and cultural extravaganza hosting a mélange of fun events and activities coupled with the splendour of the main entertainment attraction on the nights with their high wattage pulsating music, the mirth and the merry making, all adding up to three evenings which are the talk of the town. This is one of the biggest fests Northern part of the country ever witness. Our philosophy is governed by the fact that happiness should not involve any cost and therefore we do not charge any entry fee or pass from a walk in visitor.\r\n\r\nMore than a hundred events take place at PECFEST in which students from colleges across India participate, win and celebrate. It’s a three day fest so we have three professional nights to enjoy.',' PEC University of Technology, Chandigarh','Haryana','Chandigarh',' PEC University of Technology','ALL DEPARMENTS','static/img/PECfest-2015-Techno-Cultural-Fest-PEC-University-of-Technology-Chandigarh-October-30--November-01-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(43,'Deepak','deepak@gloabalensolutions.com',9789761928,'Waves ’15','2015-11-06 00:00:00','2015-11-08 00:00:00',5,7,' Waves- Escape Reality is the 2015 edition of the annual cultural festival of BITS Pilani. It offers a wide range of events in diversified fields in order to ensure that everyone who attends has an unforgettable time and there in not a dull moment while Waves is going on. Waves in one of the biggest cultural festivals in India and has the distinction of being the fastest growing festival in the country.\r\n\r\nSo join us at Waves ’15 and be ready to Escape Reality to go on a breath-taking journey to the world of fiction and fantasy from 6th to 8th November this year. See you all there!','BITS Pilani K.K.Birla Goa Campus, Goa-403726','Goa','Goa','BITS Pilani','ALL DEPARMENTS','static/img/Waves-2015-Cultural-Fest-BITS-Pilani-K.-K.-Birla-Goa-Campus-Goa-6-8-November-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(44,'Pradeepa','rpradeepa812@gmail.com',9789761928,' Tecnoesis 2015','2015-10-30 00:00:00','2015-11-02 00:00:00',5,7,'NIT Silchar brings you the 12th version of its annual Techno-management festival on 1st week of November Reincarnated from “Incandescence”, the annual Techno-cultural festival,  this year is all set to establishes itself as one of the best technical fest of the North-East.','Nit Silchar, Silchar, Assam -788010','Assam','Silchar','Nit','NIL','/events/Tecnoesis-2015-Technical-Fest-NIT-Silchar-Silchar-Assam-October-30-to-November-02-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,'Pradeepa','rpradeepa812@gmail.com',9789761928,'HORIZON-2016 ','2016-02-26 00:00:00','2016-02-28 00:00:00',5,7,'“Horizon” an Annual Cultural Festival has been ranked amongst the Top 5 college level cultural festivals in Mumbai and as the Largest in Navi Mumbai (Source: Times of India, JAM). And an astounding footfall of over 25,000 students is recorded every year. A short glimpse into Horizon’s past will show you how deep the spirit of Horizon is rooted within the student community. The festival covers a wide range of genres ranging from adventure to sports; thrill to casual; photography, personality, talent, sin city, technical, art, drama and many more. This broad spectrum has been created for students with different passions and interests to come forth and participate. Bollywood Night is a major crowd puller and has previously hosted Bollywood singers like Shankar Mahadevan, Mohit Chouhan, Suraj Jagan, Benny Dayal, and Nakash Aziz to name a few.','Ramrao Adik Institute of Technology, Dr. D. Y.Patil Campus, Nerul, Navi Mumbai, Maharashtra','Maharashtra','Navi Mumbai','Ramrao Adik Institute of Technology','ALL DEPARMENTS','/events/HORIZON-2016-Cultural-Festival-Ramrao-Adik-Institute-of-Technology-Dr.-D.-Y.Patil-Campus-Nerul-Navi-Mumbai-Maharashtra-February-26-28-2016.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(48,'Deepak','deepak@gloabalensolutions.com',9789761928,'ICHCI\'16 -2nd IEEE International Conference ','2016-03-10 00:00:00','2016-03-11 00:00:00',1,4,' IEEE International Conference on Human Computer Interactions (ICHCI’16) is the 2nd in this series of conference. The 1st edition of ICHCI was held in 2013 and received participants from all around the globe.\r\n\r\nThe Objective of IEEE-ICHCI’16 is to provide a platform to share and learn the recent developments in various sub-fields of HCI. Today, the world is moving towards Internet of Things (IoT) where the things around us will be smart and can provide and share information with humans as well as with other similar objects. Several ideas, innovations, research and developments are taking place in IoT. \r\n\r\nCloud Computing and Big Data are the next emerging areas. Today, large volumes of data are available and hence handling these data remains a big challenge. Parallelly, Wearable Electronics and Gesture Recognition are also being developed. All these lead to the utilization and sharing of information where data integrity becomes a big issue. So, ICHCI’16 will provide a platform for all researchers, academician and industrial professionals to share their work and also provide answers/ideas to the existing problems and challenges.\r\n\r\nOther Details:\r\n\r\nFull paper Submission Deadline                   :  31 Dec 2015\r\nIntimation of Acceptance                             :  15 Jan 2016\r\nCamera Ready Paper Submission Deadline   :  25 Jan 2016\r\nLast Date of Registration                              :  10 Feb 2016','Saveetha School of Engineering, Saveetha University\r\nChennai, Tamil Nadu, India','Tamil Nadu','Chennai','Saveetha School of Engineering','Dept of CSE/IT & ECE','static/img/Saveetha_University_Chennai.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(49,'Deepak','deepak@globalensolutions.com',9789761928,'Cognito 2015','2015-12-16 00:00:00','2015-12-18 00:00:00',3,6,'Taking place on the 16th, 17th and 18th of December, this three day fest will test the limits of your technical ability and business prowess by pitting you against teams from around the country and challenging you with a plethora of tasks that will change the way you perceive the business world. Further updates would be put up on the website and our Facebook page as well as our Instagram page (www.instagram.com/cognitodps)','Department of Professional Studies, Christ University, Hosur Road, Bengaluru, Karnataka 560029','Karnataka','Bangalore','Christ University','Department of Professional Studies','static/img/Cognito-2015-Management-Fest-Christ-University-Bengaluru-Karnataka-December-16-18-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(50,'Deepak','deepak@globalensolutions.com',9789761928,'National HR Summit a Management Summit','2015-10-31 00:00:00','2015-11-01 00:00:00',3,5,'In this HR Summit, several Human Resources professional from different parts of India and from different fields are expected to participate. The HR Summit will witness presentations and deliberations by Eminent CEO’s, Senior HR Professionals, Researchers, and Academicians.','Indian Institute of Information Technology & Management, Gwalior, Morena Link Road, Gwalior, Madhya Pradesh','Madhya Pradesh','Gwalior','Indian Institute of Information Technology ','ALL DEPARTMENTS','static/img/events_2.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(51,'Deepak','deepak@globalensolutions.com',9789761928,'Varchas 2015','2015-10-29 00:00:00','2015-11-02 00:00:00',5,7,' With a footfall of over 1000, Varchas is north-west India’s biggest sports fest. It is organized over a span of four days by the student community of IIT Jodhpur. With exciting events like pro-nites and marathons, Varchas is sure to give you that adrenaline rush. Varchas will feature the following games:- Athletics, volleyball, cricket, football, tennis, table tennis, squash, basketball, aquatics, chess and badminton. The games will happen in well managed grounds and winners are sure to win some well-deserved fame and exciting prizes. The contingent with maximum point will win the overall championship award.','IIT Jodhpur, Jodhpur, Rajasthan\r\n\r\nOld Residency Road, Ratanada, Jodhpur, Rajasthan, pin-342011','Rajasthan','Jodhpur','IIT','ALL DEPARTMENTS','static/img/Varchas-2015-Sports-Fest-IIT-Jodhpur-Jodhpur-Rajasthan-29-October-2015-to-2-November-2015.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(52,'Deepak','deepak@globalensolutions.com',9789761928,'Antaragni a Culture Fests','2015-10-29 00:00:00','2015-11-01 00:00:00',1,7,'Indian Institute of Technology, Kanpur is one of the most acclaimed centres of learning in the world and undoubtedly the most respected educational institute in India. ANTARAGNI, the Annual Cultural Festival of the Institute is all set to reach hitherto unprecedented heights this year. Antaragni today has firmly established itself as a brand and in its Golden Jubilee i.e. “The 50th edition”, its visibility is going to get even bigger and better than ever. In fest following events will be organized –\r\n\r\n    Dance\r\n    Dramatics\r\n    Musicals\r\n    Fine Arts\r\n    Hindi Lits\r\n    English Lits\r\n    Quiz\r\n    Films & Photography\r\n    Synchronicity\r\n    Junoon\r\n    Ritambhara\r\n    MUN\r\n    ALI\r\n    Mridaksh\r\n    Unplugged\r\n    Prima Nocte\r\n    Synchronicity\r\n    Reverberation\r\n    Blitzkrieg\r\n','IIT Kanpur, Kanpur, Uttar Pradesh','Uttar Pradesh','Kanpur','IIT','ALL DEPARTMENTS','static/img/Antaragni-Culture-Fests-IIT-Kanpur-Kanpur-Uttar-Pradesh-29-October-2015-to-1st-November-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(53,'Deepak','deepak@globalensolutions.com',9789761928,'5th National Conference on Emerging Technologies ','2015-11-23 00:00:00','2015-11-25 00:00:00',1,4,'NCETCE-2015 aims to provide a stage for expert technical exchanges and exhibition regarding the advanced technologies, equipments, techniques and innovations applied in field of Computer Engineering. It has attracted governmental officials, multinational experts, managers, researchers and technicians in relevant field to discuss together their ideas and experiences.\r\n\r\nThe Organizing Committee of the NCETCE-2015, with its utmost sincerity, intends to invite all the related experts and scholars in the country to attend the Conference, and to realize the most extensive exchanges and discussion in this field\r\n\r\nTopics are not limited to:\r\n\r\nWeb Applications & Network Security\r\n\r\nData Mining, Data Warehousing & Knowledge Discovery\r\n\r\nArtificial Intelligence, Fuzzy Logic & Genetic Algorithms\r\n\r\nSoftware Engineering & Software Product Development\r\n\r\nImage Processing & Pattern Recognition\r\n\r\nMobile and Pervasive Computing\r\n\r\nHigh Performance Computing\r\n\r\nBig Data Analytics\r\n\r\n','Computer Science Engineering\r\nSKIT, Jaipur-302017, Rajasthan','Rajasthan','Jaipur','SKIT','ALL DEPARTMENTS','static/img/5th-National-Conference-on-Emerging-Technologies-in-Computer-Engineering-NCETCE-2015-SKIT-Jaipur-Rajasthan-23-25-November-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(54,'Deepak','deepak@globalensolutions.com',9789761928,'CONCOURS','2015-10-29 00:00:00','2015-11-01 00:00:00',5,7,' Concours is the 2nd largest annual sports festival held in Gujarat where colleges from all across India participate and it witnesses a footfall of around 10,000.\r\n\r\nIt comprises of 9 sports including:\r\n\r\n    Cricket\r\n    Football (Girls and Boys)\r\n    Basketball (Girls and Boys)\r\n    Volleyball (Girls and Boys)\r\n    Lawn Tennis\r\n    Chess (Girls and Boys\r\n    Carrom (Girls and Boys)\r\n    Badminton (Girls and Boys)\r\n    Table Tennis (Girls and Boys)\r\n','Gandhinagar-Ahmedabad Road, Near Indroda Circle, Gandhinagar, Gujarat 382007','Gujarat','Gandhinagar','DA-IICT','ALL DEPARTMENTS','static/img/CONCOURS-Sports-Fest-DA-IICT-Gandhinagar-Gujarat-October-29-to-November-01-2015.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(55,'Pretheev','pretheevraj@gmail.com',8754405589,'Technovanza 15','2015-12-26 00:00:00','2015-12-28 00:00:00',1,6,'Technovanza is the Annual Techno-management Event organized by VJTI. The motto of Technovanza is to educate people about the principles of Engineering and thus spreading the knowledge of Engineering and Technology to the society at large.\r\n\r\nThe event’s popularity has grown in leaps and bounds over the years and last year close to 25000 people from all over the country attended the event, leading to its grand success. To the under-privileged students in schools the social initiative, Pratigya inspires them to become innovative engineers of tomorrow and to make Mumbai a better place to live, Mission Mumbai gives innovative solutions as future engineers to empower the society. Reaching out to students, industry and the society in general, Technovanza 2015 promises to be bigger than ever!\r\n','H. R. Mahajani Marg, Matunga Road, Mumbai, Maharashtra 400019','Maharashtra','Mumbai','Veermata Jijabai Technological Institute VJTI','Veermata Jijabai Technological Institute VJTI','static/img/11892022_10153701134634672_4626537576795432402_n.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(56,'pretheev','pretheevraj@gmail.com',8754405589,'Techfest 15-16','2015-12-26 00:00:00','2015-12-28 00:00:00',1,9,'This competition is a part of Aerostrike event organised in Techfest, IIT Bombay which will be held in 26th -28th Dec, 2015. Aviators display their flying skills and the capabilities of their aircraft to spectators with cutting edge manoeuvres usually by means of aerobatics. All students, research scholars, company experts, etc. with a valid identity card of their respective educational institutes/company are eligible to participate in the event. A team can consist of a maximum of 4 participants. Students from different educational institutes can form a team.\r\nAll teams are have to submit the abstract and video (Online or offline) of their RC Plane. The participants need to show their aircraft, the basic functions of their remote control, fly the aircraft with which they will be participating in the event and demonstrate its launch/take off, flight and landing. This video will be used to shortlist teams for the competition. Only short listed teams will be eligible to participate in the Aviator at Techfest 2015-16.','Powai, Mumbai, Maharashtra 400076','Maharashtra','Mumbai','IIT Bombay','IIT Bombay','static/img/50.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(57,'pretheev','pretheevraj@gmail.com',8754405589,' Technical Festival ','2015-12-26 00:00:00','2015-12-28 00:00:00',1,6,'Asia\'s Largest Science and Technology Festival organized by the student community of IIT Bombay. The 19th edition is from 26th-28th December, 2015.\r\nThe aim is to design innovative lamp suitable for study purpose based on solar.\r\nIIT Bombay has initiated a Right to Light program called Million SoUL for providing solar study lamp to each school going student to guarantee to them light for study purpose every evening.so they organised a competition named SoUL.\r\nThe purpose of the competition is to make solar photovoltaic based lamp. This device should be location independent, i.e. adaptable to anywhere in the world and will be used as open source design.\r\nAll participants consisting of students, research scholars, company experts, etc. with a valid identity card of their respective educational institutes/company are eligible to participate in the event are eligible to participate.\r\nThere will be a Forum on website where you can ask any of your queries to expertise after registration.\r\nRules,terms and conditions and other details are given on the http://techfest.org/soul\r\n','IIT Bombay, Powai, Mumbai 400 076, Maharashtra, India','Maharashtra','Mumbai','IIT Bombay','IIT Bombay','static/img/resources-for-hydranoid-techfest-2015-iit-bombay-19-638.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(58,'pretheev','pretheevraj@gmail.com',8754405589,'International Robotics Challenge 15','2015-12-26 00:00:00','2015-12-28 00:00:00',1,6,'\r\n\r\nDescription: This competition is a part of International Challenge event organised in Techfest, IIT Bombay which will be held in 26th -28th Dec, 2015.Bots will display their capabilities to coordinate and to solve grid. All students with a valid identity card of their respective educational institutes/company are eligible to participate in the event. A team can consist of a maximum of 5 participants. Students from different educational institutes can form a team.\r\n','Powai, Mumbai, Maharashtra 400076','Maharashtra','Mumbai','IIT Bombay','IIT Bombay','static/img/0.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(60,'pretheev','pretheevraj@gmail.com',8754405589,'KRITVA 15\'','2015-10-28 00:00:00','2015-10-16 00:00:00',3,8,'Event Description\r\nLove Cars? For those who are into all things auto, The Marketing Club, IMI New Delhi presents Mahindra AQ!\r\n\r\nA quiz that will have Auto Enthusiasts from across the country revving up to overtake each other in this challenge. Mahindra AQ is more than people demonstrating their auto gyaan. It\'s about auto lovers learning from each other and exploring the exhilarating world of automobiles.\r\n\r\nSo, if you have the spark in you, turn your engines on, unleash the horses and let them conquer.\r\n\r\nRegister in teams of two (The Driver and the Navigator) in full throttle to navigate through the map :\r\n\r\nStart line - Registration (in teams of two - The driver and the navigator)\r\n\r\nCheckpoint 1 - Online Quiz\r\n\r\nCheckpoint 2 – IMI, New Delhi (Final round)\r\n\r\nFinish Line - Goodies, certificates from Mahindra AQ\r\n\r\n\r\nPRIZES \r\n\r\nCertificates and prizes worth INR 50,000 to be won.\r\n \r\n\r\nStudents from both first and second year are welcome to participate in the Mahindra AQ competition. \r\n\r\nLast Date of registrations is 27 September, 2015.','B-10, Qutab Institutional Area, Tara Crescent, New Delhi, Delhi 110016','Delhi','New Delhi','International Management Institute','International Management Institute','static/img/CLBz1BcUkAA9sD3_1.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(61,'pretheev','pretheevraj@gmail.com',8754405589,'Dynamic karting Challenge','2015-10-23 00:00:00','2015-10-25 00:00:00',1,6,'Dynamic karting challenge is the Design and fabrication event which is going to organized by the “Association of Innovation and Mectra Engineers “in the first time of Indian history. In DKC the graduate and undergraduate engineering student can participate by designing and fabricating their own go – kart. This competition will consist of several stages of test where the go – kart fabricated by the student will go through several test. After qualifying the tests successfully, the vehicles will have a final race. All the team participated in the event are free to design and fabricate their go – kart according to their imagination but also considering the rules and regulation which is provided by the AIME for student safety. ','New Delhi, Delhi','Delhi','New Delhi','AIME','AIME','static/img/event.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(62,'pretheev','pretheevraj@gmail.com',8754405589,'ka-ching 2015 Kaching_ Narsee Monjee Management fe','2016-01-22 00:00:00','2016-01-23 00:00:00',3,5,'The economics fest of NMIMS SAMSOE is here! In it\'s fifth iteration, it\'s bigger and better than ever. With event ranging from hardcore economics, to events with a little bit of fun for everyone! This year is going to be remembered as the best year of Ka-Ching! We promise that you will have your mind tested, your economic knowledge brought to test in a practical manner and your hidden fun side shown to all, in these jam packed days! This page will be updated with debates and polls that everybody can participate in. You will also get to view the madness that will be going on in the college with our photo uploads. Brace yourselves, economists, it\'s going to one hell of a ride!','Mumbai, Maharashtra','Maharashtra','Mumbai','Narsee Monjee Institute For Management Studies','Commerce','static/img/ka-ching.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(63,'pretheev','pretheevraj@gmail.com',8754405589,'Colossus v5.0','2015-10-17 00:00:00','2015-10-18 00:00:00',1,3,'“Colossus” is one of the phenomenal gems of IEEE-ASET. The technical festival was first organized on 21st and 22nd January by IEEE Student Branch of Amity School of Engineering and Technology, Bjiwasan, New Delhi. The fifth version of this technical marathon encompasses 2 online and 12 offline events like t-shirt designing , bouquet foam craving , roborace, robohustle etc. which acts as a platform for nurturing various talents like designing, imagination, programming etc. The two day technical program enjoys colossal success every year and creates unforgettable memories for all people associated with it.\r\n',' 580, Najafgarh Kapashera Rd, Dalmia Vihar, Bijwasan, New Delhi, Delhi 110061','Delhi','New Delhi','Amity School of Engineering and Technology, Bijwas','CSC, IT, ECE','static/img/poster.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(64,'pretheev','pretheevraj@gmail.com',8754405589,'Taarangana 16','2016-01-29 00:00:00','2016-01-30 00:00:00',5,7,'It is a 2 day event on January 29-30 and includes a pethora of events in various different arts like singing, dancing, street plays, fashion events, battle of bands, literature etc.\r\n\r\nWe have an online and offline reach of 20k+ and expecting a footfall of above 9k.\r\n\r\nBeing a centrally located college at Kashmere Gate and a renowned university we attract crowd from colleges like IIT Delhi, DTU, NSIT, DU, IP university and many private colleges across Delhi and NCR.','Inter State Bus Terminal, Kashmere Gate, Near Kashmere Gate Metro Station, New Delhi, Delhi 110006','Delhi','New Delhi','Indira Gandhi Delhi Technical University for Women','Indira Gandhi Delhi Technical University for Women','static/img/B7hz6NGCcAAs1KC.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(65,'pretheev','pretheevraj@gmail.com',8754405589,'NIRVANA \'15 ','2015-10-17 00:00:00','2015-10-17 00:00:00',3,6,'All Kerala Zero - Waste Management Meet 15\r\n\r\nNIRVANA \'15 conducts a series of events to spread the importance of SOCIAL ENTREPRENEURSHIP - INNOVATIONS WITH A SOCIAL COMMITMENT. An ALL KERALA MANAGEMENT MEET supported by various events !!\r\nCause when we THINK, we INNOVATE, and we MAKE IT HAPPEN !!!','St. Joseph\'s College (Autonomous),\r\nDevagiri Road, Near Medical College Junction, \r\nDevagiri, Ummalathoor, Kozhikode, Kerala 673008','Kerala',' Kozhikode','St. Joseph College (Autonomous), Devagiri','COMMERCE , BBA','static/img/R-368088-1380573208-7888.jpeg.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(66,'pretheev','pretheevraj@gmail.com',8754405589,'CALIGO 15','2015-10-19 00:00:00','2015-10-20 00:00:00',3,2,'CALIGO 2015 A superfluity of flabbergasting events to assay and corroborate the caliber of mushrooming profess- ionals.These events at Caligo’15 aim at creating a pool of proficient Management professionals. It creates an arena of young talented budding managers who compete to succeed and make remarkable moments at the fest. Caligo 2014 was accepted and cherished by the South Indian crowd as one of the top rated Management fest attracting a massive 650+ participants from more than 50 colleges.\r\n','SH41, Peermade, Kuttikkanam, Kerala 685531','Kerala',' Kuttikkanam','Marian International Institute of Management','MBA','static/img/download.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(67,'pretheev','pretheevraj@gmail.com',8754405589,'KarmAnta 2K15','2015-10-26 00:00:00','2015-10-27 00:00:00',3,2,'KarmAnta 2015’ unfurls a world of flabbergasted events,not only to awe you, but to equip you to face the ever dynamic environment of contingencies...\r\nPresenting the vociferous Fiesta where\r\nWonders Never Cease.......','Vimal Jyothi Institute of Management and Research\r\nKannur\r\nKerala\r\nIndia','Kerala',' Kannur','Vimal Jyothi Institute of Management and Research','MBA','static/img/7292d2cc84843bc3aae602b07be946a3.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(68,'pretheev','pretheevraj@gmail.com',8754405589,'Asccend 2K15','2015-10-28 00:00:00','2015-10-29 00:00:00',3,6,'ASCEND 2K15 is this year\'s edition of national level technical symposium conducted by Department of Computer Science and Engineering, Saintgits College of Engineering, Kottayam.\r\nThe event provides all streams of engineering students with various opportunities to show case their technical skills and be recognized while gaining good quality experience.\r\nIt is organized by Exquisite Computer Engineers League, group consisting of Computer Engineering students, in association with CSI chapter of the college.\r\n\r\nThe technical extravaganza for techies, geeks, nerds out there. Come and show off your skills and talents. Let the world know You are You.','Korachankandy, Thenhipalam, Kerala 673635','Kerala','Thenhipalam','DCMS University of Calicut','CSE','static/img/Ascend_2K15.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(69,'Deepak','deepak@globalensolutions.com',9789761928,'We Are The World','2015-11-28 00:00:00','2015-11-29 00:00:00',5,2,'The Rotaract Club of H.R. College has been organizing a mega inter-school event called “We Are the World” \r\n\r\nsince the past fourteen years. WE ARE THE WORLD 2015 – The 15th Annual Inter-School International Cultural \r\n\r\nExtravaganza is a platform for school students to showcase their talents in the field of Performing Arts, Fine \r\n\r\nArts, Literary Arts, and other Crossover events in an international theme.\r\n\r\nThis mega affair is unlike any other inter-school event because of its International theme. It is one event that \r\n\r\nhas gained its reputation amongst the school children in Mumbai and it is by far the Biggest Festival for school \r\n\r\nstudents in Mumbai City. Moreover its exclusivity lies in the fact that it is the only festival of its kind which sees \r\n\r\na footfall of over 4000 students under one roof. \r\n\r\nWE ARE THE WORLD 2015 is scheduled to be held on the 28th and 29th November, 2015 (Saturday & Sunday) at St. Stanislaus School, \r\n\r\nBandra.\r\n\r\nEvent Details/Highlights\r\n\r\nDAY 1 - SATURDAY, 29th NOVEMBER, 2014\r\n\r\nNo. Time Event Description AV Participants Venue \r\n\r\n1. 1:00 – 2:30 Breaking Dawn Registration Admin Unlimited Ground \r\n\r\n2. 2:30 – 3:00 The Pursuit of Happyness Inauguration Admin Unlimited Auditorium \r\n\r\n3. 3:00 – 4:00 Get Smart Quiz Eliminations LA 10 teams(2) Classroom \r\n\r\n4. 3:00 – 5:00 The Artist Backdrop FA 1 team(6) Foyer \r\n\r\n5. 3:00 - 5:00 Monalisa Smile Sand Art FA 1 person Foyer \r\n\r\n6. 3:00 – 5:00 Pirates of The Caribbean Treasure Hunt Crossover 1 team(4) All Over \r\n\r\n7. 3:00 – 5:30  Showdown Th