:00:00','2015-11-01 00:00:00',3,2,'Tathva is an annual techno-management festival, organized by the National Institute of Technology Calicut at Kozhikode, in Kerala, India, in the month of September or October. It is one of the biggest technical festivals in South India.\r\n\r\nThe festival started as a small-scale technical festival during the era of Regional Engineering Colleges (REC). It has now grown, attracting about 9,000 students in over 50 events and with prize money of around Rs. 1.8million in 2014.\r\n\r\nAimed at inspiring innovation, technical interest among students, and awareness among the public, the event hosts lectures, seminars, workshops, competitions, paper presentations, exhibitions, quizzes, model displays and robotics events.',' NIT CAMPUS PO, Chathamangalam, Kozhikode, Kerala 673601\r\n','Kerala','Kozhikode','National Institute of Technology Calicut','National Institute of Technology Calicut','static/img/Tathva-2013.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(71,'Deepak','deepak@globalensolutions.com',9789761928,'International Robotics Challenge','2015-12-25 00:00:00','2015-12-25 00:00:00',1,6,'The main task is to design a manual and autonomous bot which will able to coordinate with each other.Autonomous bot will solve grid by following white lines and avoiding nodes while manual bot will walk over the wooden planks, transfer the block to deposit zone and help the autonomous bot to reach the final position within 6 minutes.\r\n\r\n \r\n\r\nDescription: This competition is a part of International Challenge event organised in Techfest, IIT Bombay which will be held in 26th -28th Dec, 2015.Bots will display their capabilities to coordinate and to solve grid.  All students  with a valid identity card of their respective educational institutes/company are eligible to participate in the event. A team can consist of a maximum of 5 participants. Students from different educational institutes can form a team.\r\n\r\n \r\n\r\nHow to apply: To register\r\n\r\nVisit www.techfest.org -> Competition -> International Challenge ->International Robotics Challenge -> Countries -> Register\r\n\r\nfor eg. Direct link for regisration in India is here:  http://www.techfest.org/ircindia/register','IIT Bombay','Mumbai','Mumbai','IIT ','COMMON TO ALL','static/img/robot.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(72,'Deepak','deepak@globalensolutions.com',9789761928,'International Conference on Advances in computing ','2016-03-11 00:00:00','2016-03-11 00:00:00',1,4,'Departments That Are Eligible for Participated In this Fest :\r\n\r\n    Computer Science and Engineering\r\n    Information Technology\r\n    Electronics and Communication Engineering\r\n    Electronics and Electrical Engineering\r\n    Electronics and Computer Engineering\r\n    Electronics and Instrumentation Engineering\r\n    Mechanical Engineering\r\n    Energy\r\n    Metallurgy\r\n    Agricultural\r\n    Medical\r\n    Pharmacy\r\n    Civil Engineering\r\n    Chemical Engineering\r\n    Industrial Production Engineering\r\n    Physics\r\n    Tele Communication\r\n    BioTechnology\r\n    Master of Computer Applications\r\n\r\nEvent Categories In This Fest:\r\n\r\n    Technical\r\n    Conference\r\n    Paper/Poster Presentations\r\n','Anantha Lakshmi Institute of Technology and Sciences\r\nAdityana, Assam','Assam','Adityana','Anantha Lakshmi Institute of Technology and Scienc','COMMON TO ALL','static/img/International_Conference_on_Advances_in_computing_Logic_Technology_and_Sciences.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(73,'Deepak','deepak@globalensolutions.com',9789761928,'SANGATI','2015-11-19 00:00:00','2015-10-19 00:00:00',3,4,'IIT SCHOOL OF RURAL MANAGEMENT (KSRM) BHUBANESWAR, a national level institute in the field of rural management offers 2 year post-graduate programs (MBA) in Rural Management. KSRM is organising its Annual Student Conclave\r\n\r\n                              “SANGATI 2015”\r\n\r\n                                                 On 19th November 2015 with the theme\r\n\r\n                                                  “WATER AND SANITATION”\r\n\r\nWith a focus on market based solutions. With the advent of different national schemes on Water and Sanitation, there’s a scope to intervene in this area of serious concern.\r\n\r\nSangati 2015 is conceived as a national level one day event with range of competitions that test both the professional and creative skills of students. Be a part of change that we are aiming to achieve as part of global sustainable development goal (SDG 6)\r\n\r\nWe are glad to extend this invitation to your institution to participate in “SANGATI 2015”.','KIIT School of Rural Management, bhubaneswar','bhubaneswar','bhubaneswar','KIIT School of Rural Management','COMMON TO ALL','static/img/SANGATI.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(74,'pretheev','pretheevraj@gmail.com',8754405589,'WaVes 2K15','2015-10-30 00:00:00','2015-10-30 00:00:00',3,6,'WAVES 2K 15 is an exclusive annual management fiesta organised by School of Management and Entrepreneurship (SME) KUFOS , kochi. There are four events, namely Gold Coast,Zuima,Super Tubes,Lima which aims at testing the management capability with regard to each area of management. Gold Coast ( Best Manager) Zuima ( Business Quiz ) Super Tubes ( Hr Game) Lima ( Marketing Gmae )\r\n','Kannadi Kadu Service Rd, Near Madavana Junction, Panangad, Kochi, Kerala 682506',' Kochi','Kerala','Kerala University of Fisheries and Ocean Studies','MBA','static/img/waves_poster.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(75,'Deepak','deepak@globalensolutions.com',9789761928,'P3C - Project Paper Presentation Competition','2015-11-14 00:00:00','2015-11-14 00:00:00',5,6,'Project Paper Presentation Competition [P3C]– a contest for 2014 & 2015 passed out Software / IT branch students. The competition is a proven platform to test knowledge in the form of projects and showcase them to the wide range of professionals.\r\n\r\n \r\n\r\nWideVision has played a dominant role in uprising the students’ talents to the job level. With this event we give students a platform to showcase their projects and in return winners would get handsome perks and job assistance.\r\n\r\n \r\n\r\nIn present scenario, most of the projects done during studies are either left unnoticed afterwards or simply ignored. The time and labor students put needs to be recognized and they should be awarded for their creativity and development.\r\n\r\n \r\n\r\nWhat is required?\r\n\r\nTo be a part of this competition, students will have to submit their academic projects along with complete documentation. Project could be on any platform or language but it should be fully functional and working. While shortlisting projects we would focus on aspects like project idea, functionality, code standard, level of documentation, project uniqueness, designing approach.\r\n\r\n \r\n\r\nPlatform Details\r\n\r\nThe technology sub-categories under the theme “P3C” are:\r\n\r\n1) Desktop (Java, .Net etc)\r\n\r\n2) Web (PHP, .Net etc)\r\n\r\n3) Mobile\r\n\r\na) Cross Platform (Xamarin, Phonegap etc)\r\n\r\nb) Native (iPhone, Android)','WideVision Technologies Ltd.\r\nIndore, Madhya Pradesh','Madhya Pradesh','Indore','WideVision Technologies Ltd.','COMMON TO ALL','static/img/P3C_-_Project_Paper_Presentation_Competition.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(76,'Deepak','deepak@globalensolutions.com',9789761928,'Second National Conference on Recent Innovations ','2015-11-07 00:00:00','2015-10-08 00:00:00',1,4,'Second National Conference on Recent Innovations in Engineering and Technology-2015 (NCRIET-2015) to be held at Bheemanna Khandre Institute of Technology (BKIT), Bhalki on 7th & 8 Nov 2015. NCRIET-2015 is organized by Electronics and Communication Engineering Department.\r\nNCRIET-2015 offers a track of quality R&D updates from Students, Engineers, Researchers and Scientists to provide an opportunity in bringing the new technology and perspectives that will contribute to Electronics and Communication Engineering, Mechanical Engineering, Computer Science Engineering and Civil Engineering in the next few years.\r\nAll submitted papers will be under peer review and accepted papers will be published in Indian Journal of Scientific Research (IJSR). Conference Proceedings (Hard Copy) will be published with ISBN and ISSN (IJSR print version). Both academia and industries are invited to present their papers dealing with state-of-art research and future developments.\r\n\r\n','Bheemanna Khandre Institute of Technology, Bhalki','Bhalki','Bhalki','Bheemanna Khandre Institute of Technology','COMMON TO ALL','static/img/Second_National_Conference_on_Recent_Innovations_in_Engineering_and_Technology_2015_NCRIET-2015.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(77,'Deepak','deepak@globalensolutions.com',9789761928,' KHANIJ RAJIV GANDHI FEST','2015-11-06 00:00:00','2015-10-08 00:00:00',5,6,'Khanij (minerals) have always defined the era of development the human civilization is in , right from stone age on to iron age ,further to the ongoing oil age. Realizing the quantum of emphasis that this petroleum and oil field command we are organizing KHANIJ’15. \r\n\r\nKHANIJ, the annual science and technology festival of Rajiv Gandhi Institute of Petroleum Technology (RGIPT), is the proactive students effort towards creating an experience that not only exhilarating in its sheer grandeur, but also a trigger for curiosity. Be it the interesting and thrilling workshops, national level competitions and informative guest lectures, Khanij has been successful in bringing together the best there is in oil and gas sector. Khanij has also appealed to the masses through social and environmental issues. Patronized by the market leaders in oil and gas field, Khanij’14 has organized extraordinarily. \r\n\r\nContinuing the legacy Khanij’15 promises to bring along an avalanche of mind rattling events, scintillating workshops and exhibitions, ground breaking demonstrations and much more. Khanij’15 is all geared up to scale new feats and reach for the zenith!','Rajiv Gandhi Institute Of Petroleum Technology\r\nRae Bareli, Uttar Pradesh','Uttar Pradesh','Rae Bareli','Rajiv Gandhi Institute Of Petroleum Technology','COMMON TO ALL','static/img/KHANIJ.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(78,'Deepak','deepak@globalensolutions.com',9789761928,' National Students Space Challenge 2015','2015-10-31 00:00:00','2015-11-01 00:00:00',1,6,'National Students\\\' Space Challenge is the sole technical fest of its genre encouraging space enthusiasts to showcase their mettle in various fields of Astronomy and Astrophysics. It was conceived by Space Technology Students’ Society, a group of IITians from various disciplines working towards a common goal of motivating space interest among the student community of India, emerging as one of the major forefronts in the field of space technology. \r\n\r\nThis year NSSC is to be held from 30th October to 1st November. NSSC ’15 promises you 3days of non-stop action witnessing a showdown of ground and underwater robotics, water rocketry, coding, overnight experience and an entire plethora of competitions for the engineering brains out there to bag prizes worth more than 5 lakhs. In addition to this we are having a series of workshops and guest lectures by eminent astronomers and personalities over the globe. We have also provided the students with a chance to participate on-line before the fest through many events. Along with other exciting events there will be Amateur Astrophotography Competition which is first of its kind for college students which will provide a nationwide platform for the students to show their skills and talent.\r\n\r\nNSSC’15 has a blend of many mechanical, robotics, designing and documenting events lined up. All the details regarding various events that will be conducted in NSSC \\\'15 along with their Problem Statements are available at www.nssc.in. There would be many online events launched in the run of NSSC’15.','IIT\r\nKharagpur, West Bengal','West Bengal','Kharagpur','IIT','COMMON TO ALL','static/img/National_Students_Space_Challenge.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(79,'Deepak','deepak@globalensolutions.com',9789761928,' 3 Days Workshop on Automotive Design','2015-12-25 00:00:00','2015-12-27 00:00:00',1,1,'Autodesk Alias - User Interface - Applications of Autodesk Alias in Automotive and Product Design - Modelling with Autodesk Alias Demonstration - Theory of Continuity - Construction of Curves - Basic Surfacing.\r\n\r\nProcess Modelling Explained - Warm up Modelling - Brief Workshop Project - Concept Generation/ Sketching - Working with canvas - Concept Modelling with Alias\r\n\r\nFile Preparation - Export and Import - Design Evaluation and Presentation','Industrial Design Academy\r\nChennai, Tamil Nadu','Tamil Nadu','Chennai','Industrial Design Academy','COMMON TO ALL','static/img/3_Days_Workshop_on_Automotive_Design.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(80,'pretheev','pretheevraj@gmail.com',8754405589,'Luminance 2k15','2015-11-06 00:00:00','2015-11-07 00:00:00',3,7,' All India Management Fest attended by many B-Schools from all over India. Luminance is a platform for young minds to think hard and emit the light of creativity and knowledge to many.\r\n\r\nWe invite leading players from the industry to join us in this unique event which shows the true competitive spirit , experience and entertainment.','One School Avanue, Pullikkanam, Idukki, Kerala 685503','Kerala','Idukki','DC school of Management and Technology','All Department','static/img/a33.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(81,'Deepak','deepak@globalensolutions.com',9789761928,'ICTTE’16 ','2016-03-25 00:00:00','2016-03-26 00:00:00',1,4,'INTRODUCTION TO CONFERENCE:\r\nInternational Conference on Trends in Technology and Engineering – ICTTE’16 is organized by in association with Arjun College of Technology and International Journal for Trends in Engineering & Technology (IJTET). The aim of the conference is to carry together professionals and researchers from academic to industry to achieve their utilization in the areas and to encourage their development with genuine technology methods. The conference theme concentrates to discover the latest technological innovation, trends in technology and engineering and that are experienced by the professionals with the present strict rules and to convert these complications into prospects. Authors are approved to post original research or system documents on any appropriate topics. These can either be frequent or brief documents.\r\nCALL FOR PAPERS\r\nBudding Technologists, Scientists, Professionals and Research scholars are all invited to present their unique work, researches and practice as technical papers in the international conference beneath the below mentioned sub themes.\r\nThe international conference includes the subsequent scopes for the professionals. The research works within the extent are satisfactory for the appearance in the international conference.\r\nCSE & IT:\r\n• Artificial Intelligences(A.I.) & Pattern/Image Recognitions\r\n• Neural Networks and Biomedical Simulations\r\n• Virtual Visions, 3-D Object Retrievals, & Virtual Simulations\r\n• Data Mining, Web Image Mining, & Applications\r\n• Quality of Services and Communication Protocols\r\n• 3G/4G Network Evolutions\r\n• Mobile Computing for e-Commerce\r\n• Computer Networks\r\n• Cryptography and Foundation of Computer Security\r\n• Authentication/Authorization Issues\r\n• IDS/Firewall, Anti-Spam mail, Anti-virus issues\r\n• Wireless Access Security\r\n• Network Security Applications\r\n• Secure computing\r\n• Biometric authentication and algorithms\r\n• Cloud Computing\r\n• Web Services\r\n• Image processing\r\n• Distributed Computing — P2P, Grid, Cloud\r\n• Data Storage and Processing\r\n• Mobile Computing\r\nElectrical, Electronics and Communication Engineering:\r\n• Singnal amd Image Processing\r\n• Special machine drive and control\r\n• Trends and developments in nano technology\r\n• VLSI Design, Implementation & Application\r\n• Wirelesssensor and networksBio-medical Engineering\r\n• Broadband and Cellular Network\r\n• Electronic Design Automation\r\n• Embedded Systems & Embedded Web Servers\r\n• Evolutionary Computing Applications\r\n• Facts, HVDC and Power Quality\r\n• Health Technology\r\n• Industrial Automation\r\n• Intelligent Controllers\r\n• Optical and Microwave Communication\r\n• Power Electronics & Power Quality\r\n• Power Optimization\r\nCivil, Mechanical Engineering, Mechatronics:\r\n• Soil-Structures Interaction (Static and dynamic)\r\n• Structural Engineering\r\n• Structural Health Monitoring Technologies\r\n• Water Resources Engineering\r\n• Geotechnical analysis and design\r\n• Monitoring of Structures and Buildings\r\n• Aerospace Systems and Technology\r\n• Alternate Fuels & IC Engines\r\n• Automation and Robotics\r\n• CAD/CAM/CAE/FMS\r\n• Computational Fluid Dynamics\r\n• Conceptual Design Support\r\n• Dam Engineering\r\n• Dynamics and Earthquake Engineering\r\n• Eco-Friendly / Sustainable Technologies\r\n• Foundation Engineering\r\n\r\nPAPER SUBMISSION MAIL ID:\r\nsubmission@ictte.co.in','Arjun College of Technology\r\nChettiyakkapalayam, Thamaraikulam,\r\nKinathukkadavu, Neghamam Main road,\r\nCoimbatore - 642 120, Tamil Nadu.','Tamil Nadu','Coimbatore','Arjun College of Technology','COMMON TO ALL','static/img/index.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(82,'pretheev','pretheevraj@gmail.com',8754405589,'Ramsayana 2015','2015-11-11 00:00:00','2015-11-12 00:00:00',3,5,'RAMSAYANA 2015 is going to be a unique and remarkable management event with the presence of eminent personalities and the participation of management students all across south India, organised by RAMS B- SCHOOL. This event will bring out the intellectuals inside the budding managers.\r\nRAMSAYANA 2015 has imbibed the team that call up in us especially the trendy ones to change the life style to say goodbye to all life style diseases. Let us together march forward holding the motto of this play card tight to our hearts so as to up root all diseases caused by our moving away from nature.','Rural Academy for Management Studies, Ayyampilly Cherai\r\nErnakulam\r\nKerala\r\nIndia','Kerala','Ernakulam','Rural Academy for Management Studies','MBA','static/img/logo.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(83,'Deepak','deepak@globalensolutions.com',9789761928,'INDIACom- 2016 ','2016-03-16 00:00:00','2016-03-18 00:00:00',3,4,'INDIACom-2016 is aimed at inviting original research papers in the field of, primarily, Computer Science and Information Technology and, generally, all interdisciplinary streams of Engineering Sciences, having central focus on sustainable computing applications, which may be of some use in enhancing the quality of life and contribute effectively to realize the nations’ vision of sustainable inclusive development using Computing.\r\nThis special session on Opinion Mining and Sentiment Analysis will provide an international forum for researchers in the field of machine learning for opinion mining and sentiment analysis to share information on their latest investigations in social information retrieval and their applications both in academic research areas and industrial sectors.','Bharati Vidyapeeth’s Institute of Computer Applications and Management \r\n New Delhi, Delhi',' New Delhi',' New Delhi','Bharati Vidyapeeth’s Institute of Computer Applica','BIOTECHNOLOGY','static/img/GR.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(84,'Deepak','deepak@globalensolutions.com',9789761928,'International Conference on Inter Disciplinary','2016-02-12 00:00:00','2016-02-13 00:00:00',1,4,'International Conference on Inter Disciplinary Research in Engineering and Technology 2016\r\nICIDRET 2016 is a main annual research conference aimed at presenting new improvements and technologies in interdisciplinary areas at various levels. The conference will be held every year to make it an ideal platform for people to share views and experiences. With many experts the technological improvements are encouraged for fostering the Research in E&T.\r\n','DSIIDC, Govt. of NCT of Delhi,,\r\nConnaught Circus,\r\nNew Delhi - 110001, India. Asia','New Delhi','New Delhi','DSIIDC','COMMON TO ALL','static/img/GR_1.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(85,'Deepak','deepak@globalensolutions.com',9789761928,'Taarangana 16 ','2016-01-29 00:00:00','2016-01-30 00:00:00',1,7,'It is a 2 day event on January 29-30 and includes a pethora of events in various different arts like singing, dancing, street plays, fashion events, battle of bands, literature etc.\r\n\r\nWe have an online and offline reach of 20k+ and expecting a footfall of above 9k.\r\n\r\nBeing a centrally located college at Kashmere Gate and a renowned university we attract crowd from colleges like IIT Delhi, DTU, NSIT, DU, IP university and many private colleges across Delhi and NCR.','Indira Gandhi Delhi Technical University for Women\r\nNew Delhi, Delhi','New Delhi','New Delhi','Indira Gandhi Delhi Technical University for Women','COMMON TO ALL','static/img/1-College-Events.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(86,'Deepak','deepak@globalensolutions.com',9789761928,' Nerdz 2k15 ','2015-11-17 00:00:00','2015-10-19 00:00:00',1,7,'The Department of Computer Science, Jamia Hamdard, organizing the most awaited Annual IT fest - NERDZ \'15.\r\nThis is the moment, the time whilst the Department is stormed with activities, the rest of the varsity eagerly awaits the thrilling extravaganza with arms wide open.\r\nThis of course, is not exaggeration but ground reality.\r\nNerdz 2015 will be hosted by the department of computer science , FET.\r\nNerdz is an integral part of the computer science department and is necessary for building a strong and vibrant base, which will help in building strong image of our computer scien