he Press\r\nFootball Freniy\r\nChef D NCU\r\nZorbing\r\nIntercollege Street Play\r\nBest Fb Dp\r\nCamp Zero\r\nWar Of Dj and many more.....','The Northcap University Gurgaon\r\n Gurgaon, Haryana','Haryana','Gurgaon','The Northcap University Gurgaon','COMMON TO ALL','static/img/1-College-Events_2.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(88,'Deepak','deepak@globalensolutions.com',9789761928,'Indo Asian Solar Challenge 2016','2016-04-03 00:00:00','2016-04-07 00:00:00',5,9,'Designing and fabrication of a single seated vehicle powered by a DC motor which can run miles after miles and the potential\'s of universal energy. Such innovative research and development requires comprehension that can introduce a trend stellar automotive locomotion. Indo Asian Solar Challenge claims to be one of the most dignified and prestigious event in that arena and tempts the world\'s renowned technical universities and colleges.It is a moment of pride and gratification that Indian govt has rendered their valuable suggestion and recognized our efforts of making this dream of green revolution come somewhat true. After the previous successful venture of Indo Asian Solar Challenge -2015, RISC-LPU is all set to bloom and nurture the skills of budding engineers all around the globe in their second outing. On this outing of Indo Asian Solar Challenge 2016, the dynamic race will be 100-130 km. It has generated our intention of bringing innovation and newer aspects in this challenge. Hope this very occasion it reaches new heights and dimensions.','Lovely Professional University, \r\nJalandhar-Delhi, G.T. Road (NH-1), Phagwara, \r\nPunjab (INDIA) -144411.\r\n','Punjab','Phagwara','Lovely Professional University','COMMON','static/img/1-College-Events_3.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(89,'Deepak','deepak@globalensolutions.com',9789761928,'techNITi\'15 v.2 ','2015-11-05 00:00:00','2015-11-08 00:00:00',1,6,'techNITi call it the \'passion for innovation\' or a \'celebration of creativity\'- it\'s all about setting our wildest dreams\r\nand passion into motions.\r\n\r\ntechNITi is annual techno-managerial festival of NIT Jalandhar. It is a opportunity for students all over the country\r\nfrom diversity of fields to unite and celebrate our various identities cojoined as one!\r\n\r\nStarted in 2006- techNITi has now recognized as the biggest festival of its kind in the north zone.Over, the years,\r\ntechNITi has been giving thousands of students a platform to express in the form of Coding,Robotics,Automotives,\r\nQuest,Music,Dance,Photography,Lan Gaming, and more!\r\n\r\nWith cash distribution of 12,00,000+,techNITi\'15 V.1 witnessed the highest ever participation and all an all time\r\nhigh level of enthusiasm among the participants.Team techNITi is dedicated towards delivering the its best of best\r\nto the fest with more than 90+events,10+Mega events and 8 Pro-Shows this year\r\n\r\nEvent Caption:\r\nNorth India\'s Larget techno-managerial fest\r\nEvent Theme:\r\nEvolution of science: from Vedas to Digital India','NIT Jalandhar\r\nNH-1, Jalandhar, Punjab','Punjab','Jalandhar','NIT','COMMON','static/img/GR_2.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(90,'Deepak','deepak@globalensolutions.com',9789761928,'CU FEST \'15','2015-10-30 00:00:00','2015-10-31 00:00:00',5,7,'CU Cultural Fest is back with a bang from 30th October to 31st October 2015. A perfect stage for talent, brilliance and intelligence, this is the roller coaster every techie dreams of. One of the most successful cultural fests across the country, CU National Cultural Fest 2015 is bound to be bigger, and better than ever before - as it goes a reinvention, combining the technical and the entrepreneurial under one roof.\r\n\r\n Events in Mohali:\r\n+ Modeling\r\n+ Fashion Fiesta\r\n+ War of the Band\r\n+ Rock the Floor\r\n+ Rj Raid – Rj Hunt\r\n+ Dil Se Re - Solo Singing\r\n+ Sur Kshetra\r\n+ Mile Sur Mera Tumhara\r\n+ Magical Harmony\r\n+ Thunder Tappers\r\n+ Jam Ke Rakhna Qadam\r\n+ Punjabi Virsa\r\n+ Phulkari\r\n+ Qadam Mila Ke\r\n+ Dance to Express\r\n+ Al’Sharah\r\n+Sonu Kakkar LIVE\r\n+Sanha Mouditty LIVE\r\n+Keerthi Sagthia LIVE\r\n+Gajender Phogat LIVE','Chandigarh University\r\nMohali, Punjab','Punjab','Mohali','Chandigarh University','COMMON','static/img/1-College-Events_4.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(91,'Deepak','deepak@globalensolutions.com',9789761928,'SLDC -2015 ','2015-10-29 00:00:00','2015-10-31 00:00:00',5,4,'American Society of Mechanical Engineers( ASME) India’s Student Led Design Conference (SLDC 2015) Is a Zonal Level Conference.\r\nZone 1\r\nJammu and Kashmir,Punjab,Himachal Pradesh,Uttarakhand.\r\n\r\nEvent Caption:\r\nWhere Design Meets Challenge!\r\nEvent Theme:\r\nIdentify a Problem. Edify a Solution.','Lovely Professional University,\r\nJalandhar-Delhi, G.T. Road (NH-1),\r\nPhagwara, Punjab (INDIA)-144411.','Punjab','Phagwara','Lovely Professional University','COMMON','static/img/1-College-Events_5.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(92,'Deepak','deepak@globalensolutions.com',9789761928,'Youth Vibe 15 ','2015-10-27 00:00:00','2015-10-31 00:00:00',5,5,'Cultural Events-Music,Dance,Lifestyle,Fine arts,Theatre.\r\nTechnical\r\nBusiness & Management Events\r\nSports-Cricket,Volleyball,Football,Basket ball,Chess,Table tennis.\r\nMedia Events\r\nSocial Events\r\nLiterary Events\r\n\r\nYouth Vibe 15 Pro Shows :\r\nCampus princess Stunt Show Armageddon Paridhan-The fashion parade\r\n','Lovely Professional University\r\n Jalandhar, Punjab','Punjab','Jalandhar','Lovely Professional University','COMMON','static/img/1-College-Events_6.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(93,'Deepak','deepak@globalensolutions.com',9789761928,'ENTHUSIA_2015','2015-12-01 00:00:00','2015-12-20 00:00:00',1,6,'Enthusia- the annual, national level sports festival of V.J.T.I is the most awaited sports festival in the city. With over 100 colleges participating and with a footfall of 10,000 that increases every year, Enthusia hosts a variety of sports and workshops. Enthusia provides a platform for college students to showcase their skills and sporting talents . Graced with some of the best sports facilities one could ask for, this sports festival is sure to set your heartbeat racing, and give you that adrenaline rush!\r\n\r\nSports Events:\r\nOutdoor Sports:\r\nCricket, Basketball, Football, Lawn Tennis, Kho-kho, Kabaddi, Volleyball, Aquatics, Athletics,etc.\r\n\r\nIndoor Sports:\r\nBadminton, Chess, Carrom,Anti- Chess, etc\r\n\r\nDepartments That Are Eligible for Participated In this Fest :\r\n\r\n    Computer Science and Engineering\r\n    Information Technology\r\n    Electronics and Communication Engineering\r\n    Electronics and Electrical Engineering\r\n    Electronics and Computer Engineering\r\n    Electronics and Instrumentation Engineering\r\n    Mechanical Engineering\r\n    Energy\r\n    Metallurgy\r\n    Agricultural\r\n    Medical\r\n    Pharmacy\r\n    Arts and Science\r\n    Civil Engineering\r\n    Chemical Engineering\r\n    Industrial Production Engineering\r\n    Physics\r\n    Law\r\n    Tele Communication\r\n    Commerce\r\n    BioTechnology\r\n    Master of Business Administration\r\n    Master of Computer Applications\r\n    we got some error\r\n\r\nEvent Categories In This Fest:\r\n\r\n    Sports\r\n','Veermata Jijabai Technological Institute VJTI\r\nMumbai, Maharashtra','Maharashtra','Mumbai','Veermata Jijabai Technological Institute VJTI','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/ENTHUSIA.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(94,'Deepak','deepak@globalensolutions.com',9789761928,'UCC 2015 ARDL __ Space Event India','2016-01-31 00:00:00','2016-01-31 00:00:00',5,6,'Mission Overview\r\n\r\nThe mission is to launch an autonomous CanSat with a deployable lander containing a payload (size and weight of an egg). The CanSat consists of two parts, the carrier and the lander. The carrier holds & releases the lander. The term “CanSat” shall refer to complete system - the carrier and lander.\r\n\r\nThe CanSat will be deployed from a launch vehicle at an altitude of 400 to 500 meters. Once released, the CanSat shall descend at 10 meters per second using any type of passive descent control system or device. At 150 meters altitude, the CanSat carrier shall release the lander that contains the payload. The lander shall land without damaging the payload. The lander cannot free fall and it must contain a descent control system or device to reduce the descent rate to less than 5 meters per second. The carrier telemetry data should be stored on-board for post processing in the event of a communication failure.\r\n\r\nTeams must build their own ground station. Telemetry from the carrier shall be displayed, in real-time, on a team developed ground control station.\r\n\r\n \r\n\r\nQuick Guide\r\n\r\n \r\n\r\n    The team is required to design the entire module comprising of systems like Payload Unit, On Board Computer & Software Development, Telemetry & GPS Tracking, Command & Data Handling, Ground Station Control, Housekeeping & Descent Control, Power Unit & Circuitry, Structure & Payload Health Unit and others related.\r\n\r\n \r\n\r\n    The main objective of the competition is to launch your designed payload to a certain altitude and put your system to real test environment with secondary objectives to acquire the payload data and perform given tasks.\r\n\r\n \r\n\r\n    The payload design has to be done and procured by your team which will later be mounted on your fabricated structure model. We are looking for interesting and innovative payload concepts and the most innovative experiments will make it to top.\r\n    The first step of the launch is to load your structure/payload to the given casing of the launch vehicle which will deploy the CanSat at the given altitude.\r\n\r\n \r\n\r\n    The CanSat (Cylinder of 10cm diameter-20cm height & 500 grams weight) will be attached to the primary parachute’s shrouds.\r\n\r\n \r\n\r\n    The Carrier has to begin transmitting live payload data to the ground station and the data needs to be displayed graphically as well has to be stored on board for post processing of lost data. GPS tracking sequence also has to be initiated before the launch.\r\n\r\n \r\n\r\n    Upon reaching the final countdown and after launching, the Tracking team has to start monitoring the trajectory of the CanSat and follow its trail after the launch for the recovery using GPS trackers, ground station data and radio data. Remember, the module can go far away.\r\n\r\n \r\n\r\n    After the crossing of 400 m altitude, the CanSat will be deployed from the Launch Vehicle the CanSat starts its experiment from then.\r\n\r\n \r\n\r\n    Role of the descent system begins where the descent rate has to be maintained at an average of 10 m/s using parachutes designed by you.\r\n\r\n \r\n\r\n    Upon descending to an altitude of 150m, the lander will have to be deployed/released off from the Carrier and it should perform its task as selected by your team.\r\n\r\n \r\n\r\n    The locating beacon i.e. the buzzer has to be of very high intensity and should initiate after crossing 200m mark. The parachute color also should be selected properly so that the module can be located visually very easily.\r\n\r\n \r\n\r\n    After successful recovery of the module, the team need to get back to launch site for data collection and after that the team will be given 1 day time to prepare the Post Flight Review.\r\n\r\n \r\n\r\n    Collective marks of Preliminary Design Review, Critical Design Review, Launch Achievements and Post Flight Review will decide the winner of the competition.\r\n','ARDL\r\nBangalore, Karnataka','Karnataka','Bangalore','ARDL','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/University_CanSat_Challenge_2015.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(95,'Deepak','deepak@globalensolutions.com',9789761928,'Ray Festival 2015 ','2015-12-15 00:00:00','2015-12-20 00:00:00',5,7,'Ray - A journey through the lens, is the annual intercollegiate media festival of Bhavan\'s college, Andheri west.\r\nIt is one of the top media festivals of Mumbai that takes place in the month of December.\r\nIn its 7th glorious year, we have expanded our horizon and took the standard of it on a whole new level.\r\n\r\nDepartments That Are Eligible for Participated In this Fest :\r\n\r\n    Arts and Science\r\n    Media\r\n\r\nEvent Categories In This Fest:\r\n\r\n    Management\r\n    Sports\r\n    Literary\r\n    Workshop\r\n    Online\r\n    Live In Concerts\r\n    Short Movies\r\n    Photography\r\n','Bhavans College\r\nMumbai, Maharashtra','Maharashtra','Mumbai','Bhavans College','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/Ray_-_A_Journey_Through_The_Lens_.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(96,'Deepak','deepak@globalensolutions.com',9789761928,'ka-ching 2015','2016-01-22 00:00:00','2016-01-23 00:00:00',5,6,'The economics fest of NMIMS SAMSOE is here! In it\'s fifth iteration, it\'s bigger and better than ever. With event ranging from hardcore economics, to events with a little bit of fun for everyone! This year is going to be remembered as the best year of Ka-Ching! We promise that you will have your mind tested, your economic knowledge brought to test in a practical manner and your hidden fun side shown to all, in these jam packed days! This page will be updated with debates and polls that everybody can participate in. You will also get to view the madness that will be going on in the college with our photo uploads. Brace yourselves, economists, it\'s going to one hell of a ride!\r\nAnd please share this page with your friends, and encourage them to interact with it! We don\'t bite.','Narsee Monjee Institute For Management Studies\r\nMumbai, Maharashtra','Maharashtra','Mumbai','Narsee Monjee Institute For Management Studies','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/ka-ching_1.png',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(97,'Deepak','deepak@globalensolutions.com',9789761928,'SYNAPSE 2016','2016-02-25 00:00:00','2016-02-28 00:00:00',5,7,' Synapse is a celebration - a celebration of culture, technology and life.it is about relishing the underlying, inherent conjuction of the three in an electrifying atmosphere. it is one of the most prominent college fest of Gujarat, and has consistently enthralled the youth by its sheer techno-cultural magic over the years. The way we see it, it\'s not just a college fest - it is a celebration; a spectacle of our talent, aspiration, creativity and vision. The sound of the cheers can rise so high ear that you may have to cover your ears. The enthusiasm of a good crowd is unbeatable.\r\n\r\n    Synapse is the annual techno-cultural fest of the Dhirubhai Ambani Institute of Information and Communication Technology, Gandhinagar, Gujarat. It is a four-day long event held in the even semester each year and is attended by students from across all India.With events including cultural, technical, literature, gaming, business, debate, quiz, workshops and many-more.it presents the perfect platform to expose the participants to healthy competition and also bag prizes while they are at it.','Dhirubhai Ambani Institute Of Information And Communication Technology\r\nGandhinagar, Gujarat','Gujarat','Gandhinagar','Dhirubhai Ambani Institute Of Information And Comm','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/SYNAPSE_2016.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(98,'Deepak','deepak@globalensolutions.com',9789761928,'Arohan 15 ','2015-10-24 00:00:00','2015-10-26 00:00:00',1,7,'AROHAN’15 - NITIE Annual Cultural Festival from 24th-26th October, 2015 under the umbrella of AVARTAN - the NITIE Business Confluence.\r\n\r\nThe 3 day extravaganza is a confluence of Art, Culture and Entertainment. With a plethora of events, the fest is an opportune platform to showcase your skills to the world.\r\n\r\nBe a part of one of the biggest cultural fests in India. We enthusiastically look forward to your participation','NITIE, Vihar Lake Marg, \r\nNear The Residence Hotel, Powai, \r\nMumbai, Maharashtra 400087\r\n','Maharashtra','Mumbai','National Institute of Industrial Engineering NITIE','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/image.php.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(99,'Deepak','deepak@globalensolutions.com',9789761928,'Chakravyuh 2015 ','2015-10-23 00:00:00','2015-10-25 00:00:00',5,9,'Since its inception 12 years ago, it has blossomed in to one of the most popular Sports Festivals of the country. As the name suggests, Chakravyuh is a display of stunning sporting fever. Chakravyuh has come to be the centre stage for display of the latent talent in the Indian Sportsmen studying at various technical institutes of the country. Over the years, Chakravyuh has redefined qualities like ‘hard work’ , ‘persistence’,determination’ and ‘self-confidence’.\r\n\r\nWith participation from over 80 technical institutes including the IITs, NITs and other premier Engineering colleges, Chakravyuh has established itself in most record books as the most widely attended sports festival in India. With the total number of participants over 500 every year, Chakravyuh has played a perfect host to sportsmen across the country.','IMS Engineering College\r\nNH-24, Adhyatmik Nagar, Near Dasna,\r\nDistt: Ghaziabad. Uttar Pradesh-201009.\r\nPhone: (91)120-2769661, 2769662, 2769663 , 3013800 Fax: 0120-2769235\r\nE-mail: imsec@imsec.ac.in, director@imsec.ac.in\r\n','Uttar Pradesh','Ghaziabad','IMS Engineering College','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/image.php_1.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(103,'Deepak','deepak@globalensolutions.com',9789761928,'EUPHORIA 16 ','2016-01-09 00:00:00','2016-01-10 00:00:00',1,7,'\r\nList of Events\r\n1. Dance (Solo / Group/adaptive)\r\n2. Music ( Solo /Group /Instrumental)\r\n3. Admad (Mad Ads )\r\n4. Fashion hunt (Fashion competition). 5.Cini Quiz\r\n6. Art Events (Face painting, Pot painting)\r\n7. Dubsmash (ur fav dialogues)\r\n8. Siricha pochu\r\n9. Mime,variety\r\n10. CIT Selfie\r\n11.Mr/Ms. EUPHORIA\r\n12. Other Events (pot breaking / video game/Fun events /Rope pulling/mehandi/Creativity/ treasure Hunt/Stylish signature)\r\n13. Other Surprise Events','Coimbatore Institute of Technology\r\nCoimbatore, Tamil Nadu','Tamil Nadu','Coimbatore','Coimbatore Institute of Technology','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/tech-fest_3.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(104,'Deepak','deepak@globalensolutions.com',9789761928,'Plinth 16 ','2016-01-22 00:00:00','2016-01-24 00:00:00',1,8,'PLINTH is the annual inter-collegiate Techno-Management-Literary Festival of The LNMIIT, Jaipur. It encompasses and transcends the boundaries of science and technology, bringing to its audience a truly enriching experience. True to its name, its endeavour is to provide a \'platform\' to the youth to showcase their talents and skill sets in fierce competitions, display cutting edge technology and research from all over the country, showcase a perfect blend of entertainment and technology, have world renowned personalities interact with thriving young minds and foster\r\nsolutions to alleviate the common man of his banal yet significant problems, and include one and all to get inspired and look up to.In a nutshell, PLINTH 2016 promises to keep participants from all walks and tastes occupied for an awesome 3-day experience. ','The LNM Institute of Information Technology\r\nJaipur, Rajasthan','Rajasthan','Jaipur','The LNM Institute of Information Technology','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/images.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(105,'Deepak','deepak@globalensolutions.com',9789761928,'Amalthea 2015 ','2015-10-24 00:00:00','2015-10-25 00:00:00',1,5,'Amalthea is the annual technical summit of IIT Gandhinagar. It is founded in the year 2010. Amalthea is the symbol of prosperity and abundance. Our aim is to nurture the world. The focus is purely on spreading technical knowledge suffusing enthusiasm in minds to work for the greater human good. Bringing together the best minds from Industrial and Academic worlds, Amalthea promises to satisfy every enthusiast through beneficial interaction and imparting scientific and technical knowledge. Providing an avenue for showcasing innovative products, we anticipate the best technology to unveil here. Moving minds with intellectual stimulation like no other event could is where we see Amalthea in a few years.\r\nVision:\r\n1. We aspire to become the hub for interaction and knowledge sharing between the industrial and academic world.\r\n2. We aim to take forward the baton of tomorrow’s engineering leadership by providing opportunities to individuals for being potential industry attachments and recruits of the most sought after industry learning experiences.\r\n\r\n3. With special emphasis on the mainstream issues in India in particular and the world at large, Amalthea also focuses on the development agendas which are the need of the hour.\r\n\r\n4. We believe that in order to bring out the best of each contributing member, freedom to execute what he/she believes in is of utmost importance.\r\n\r\n5. We persevere to stay on the path destined for the highest levels of professional standards and achieve the relentless execution of every goal set.\r\n\r\n6. We take pride that in our ability to create means that enable the realization of highest of goals (Sky is the Limit) and standards set by IIT Gandhinagar.\r\n\r\n7. We believe that the success and “harnessability” of Amalthea is a function of student involvement. Hence, IIT Gandhinagar student body believes their contributions in terms of ideas and efforts will enrich and add to the value to the Amalthea experience.\r\n\r\nEvent Caption:\r\nProsperity Through Technology\r\nEvent Theme:\r\nTowards The Future','Indian Institute of Technology Gandhinagar (Palaj Campus), Simkheda, Gandhinagar- 382355','Gujarat','Gandhinagar','Indian Institute of Technology ','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/Cultural_Activity_Logo.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(106,'Deepak','deepak@globalensolutions.com',9789761928,'Primicerius 2015 ','2015-12-10 00:00:00','2015-10-11 00:00:00',3,6,'Bhavan’s Vivekananda Degree College will be hosting Primicerius 2015, a management fest organised by the Department of Commerce.\r\n\r\nOur college has been listed as one of the most reputed colleges and lived up to its quality services from the past 20 years & has been certified as an ‘A’ Grade Institution by NAAC and also has gained Autonomy. Now, for the fourth consecutive time, we present to you a Management Fest by the students of B.Com Honors.\r\n\r\nWe cordially invite the undergraduate students of your esteemed institution to be a part of Primicerius ’15 going to be held in the month of December 2015.','Bhavans Vivekananda Degree College\r\nHyderabad, Telangana','Hyderabad','Telangana','Bhavans Vivekananda Degree College','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/images_1.jpeg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(107,'Deepak','deepak@globalensolutions.com',9789761928,'Inbloom 2016 ','2016-02-04 00:00:00','2016-02-05 00:00:00',5,7,'Inbloom is a National Level Cultural Fest.','Christ University,\r\nBengaluru, Karnataka','Karnataka','Bengaluru','Christ University,','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/tech-fest_4.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(108,'Deepak','deepak@globalensolutions.com',9789761928,'Pravega \'16 ','2016-01-29 00:00:00','2016-01-31 00:00:00',1,7,'Pravega is the annual science, technology, and cultural fest of the Indian Institute of Science, Bangalore (IISc).\r\n\r\nIn its conception, it is the first and the largest of its kind, and is designed to attract those students who are the brightest, most creative, and most passionate about knowledge of any form. It will grow into a platform for the methodical science and experience of IISc to mingle with the exuberant and keen nature of the youth of India, each gaining from their interaction with the other.','Indian Institute of Science Bangalore\r\nBengaluru, Karnataka','Karnataka','Bangalore','Indian Institute of Science Bangalore','ALL DEPARTMENTS THAT ARE ELIGIBLE','static/img/Cultural_Activity_Logo_1.jpg',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
